import React, { useEffect, useState } from 'react';
import { Route, Redirect } from "react-router-dom";
import { context } from './context'
import axios from 'axios'

axios.defaults.withCredentials = true

export default function NewTry(){

   const [img, SetImg] = useState(null)
   const [downloadedImages, SetDownloadedImages] = useState([])

   console.log(downloadedImages);

   useEffect(() => {
      axios.get('http://localhost:4000/new').then(res => {
         console.log(res);


       SetDownloadedImages(res.data.object)
       console.log(downloadedImages);

      })
   }, [downloadedImages])

   const handleClickImg =  (e) => {
      e.preventDefault()
      const files = new FormData()
      files.append('file', img)
     axios.post('http://localhost:4000/new',
        files, {
           headers: {
              'content-type': 'multipart/form-data'
           }
        }
      ).then(res => {
        console.log(res)
      })
      }



   return(
      <div className="home-page">
          <div className="home-page-salute">
            Welcome!
          </div>
          <div className="img-container">

          {downloadedImages.map((i) => {
             <img src={`data:image/jpeg;base64,${i.buffer.toString('base64')}`}  width="100" height="50"/>
          })}
          </div>
          <div className="upload-form">
          <form > 
            <input type="file" accept=".jpeg" onChange={(e) => {
              const file = e.target.files[0]
              SetImg(file)
            }} />
            <button className="upload-btn" onClick={(e) => handleClickImg(e)}>Upload image</button>
          </form>
          </div>
        </div>
   )
}
